// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./Comptroller.sol";
import "./GoodLottery.sol";
import "./GoodInterface.sol";
import "./WishToken.sol";
import "./GoodLotteryNFT.sol";

contract WishApi {
    Comptroller comptroller;

    struct GoodInfo {
        uint256 goodIndex;
        uint256 goodId;
        uint256 goodValue;
        uint256 publishTime;
        uint256 lockedTime;
        uint256 maintenanceFee;
        uint256 joinedUsers;
        uint256 ticketCounts;
        uint256 balance;
        address winner;
        string goodHash;
        uint256 stage;
        uint256 paybackFee;
        uint256 winnerTime;
        uint256 winnerBlock;
        uint256 winnerIndex;
        address pickWinnerUser;
    }

    struct UserJoinRecord {
        string userName;
        uint256 goodIndex;
        uint256 goodId;
        address user;
        uint256 count;
        bool joined;
        bool isPaybacked;
        uint256 joinTime;
        uint256 joinBlockNum;
        bool isWinner;
        uint256 goodValue;
        uint256 paybackFee;
    }

    struct WinnerHistory {
        uint256 goodId;
        address user;
        uint256 count;
        bool joined;
        uint256 joinTime;
        uint256 joinBlockNum;
        bool isWinner;
        uint256 goodValue;
        uint256 blockNum;
        uint256 blockTime;
        uint256 index;
        string goodHash;
    }

    struct UserTransferHistory {
        address from;
        address to;
        uint256 amount;
        uint256 blockNum;
        uint256 transferType;
        uint256 goodIndex;
        uint256 goodId;
        string goodHash;
    }

    struct UserPublishedGood {
        bool isList;
        uint256 goodIndex;
        uint32 goodId;
        uint256 goodValue;
        uint256 maintenanceFee;
        uint256 publishTime;
        uint256 lockedTime;
        string goodHash;
        address nftAddress;
        uint256 tokenId;
        uint256 status;
        address nft;
        uint256 joinedUsers;
        uint256 ticketCounts;
        address winner;
        uint256 paybackFee;
        uint256 winnerTime;
        uint256 winnerBlock;
        uint256 winnerIndex;
        address goodAddress;
    }

    constructor(Comptroller _comptroller) {
        comptroller = _comptroller;
    }

    function getGoodsLength() public view returns (uint256 len) {
        return comptroller.getGoods().length;
    }

    function getGoods() public view returns (GoodInfo[] memory) {
        GoodLottery[] memory goodContracts = comptroller.getGoods();

        uint256 len = goodContracts.length;
        GoodInfo[] memory records = new GoodInfo[](len);

        for (uint256 i = 0; i < len; i++) {
            records[i] = getGoodInfo(len - 1 - i);
        }
        return records;
    }

    function getGoodInfo(uint256 index)
        public
        view
        returns (GoodInfo memory good)
    {
        GoodLottery[] memory goodContracts = comptroller.getGoods();
        if (index >= goodContracts.length) return good;

        good.goodIndex = index;
        good.goodId = goodContracts[index].goodId();
        good.goodValue = goodContracts[index].goodValue();
        good.publishTime = goodContracts[index].publishTime();
        good.lockedTime = goodContracts[index].lockedTime();
        good.maintenanceFee = goodContracts[index].maintenanceFee();
        good.joinedUsers = goodContracts[index].joinedUsers();
        good.ticketCounts = goodContracts[index].getTickets().length;
        good.balance = comptroller.token().balanceOf(
            address(goodContracts[index])
        );
        good.winner = goodContracts[index].winner();
        good.goodHash = goodContracts[index].goodHash();
        good.stage = 0;
        (
            uint256 winnerBlock,
            uint256 winnerTime,
            uint256 tickIndex
        ) = goodContracts[index].winnerTime();
        good.winnerTime = winnerTime;
        good.winnerBlock = winnerBlock;
        good.winnerIndex = tickIndex;
        good.paybackFee = goodContracts[index].paybackFee();

        return good;
    }

    function getUserTickets(uint256 index, address user)
        public
        view
        returns (uint256[] memory)
    {
        GoodLottery[] memory goodContracts = comptroller.getGoods();
        if (index >= goodContracts.length) return new uint256[](0);
        GoodLottery good = goodContracts[index];
        (
            address u,
            uint256 count,
            bool joined,
            bool isPaybacked,
            uint256 joinTime,
            uint256 joinBlockNum
        ) = good.userMapping(user);

        if (!joined || count == 0) {
            return new uint256[](0);
        }

        address[] memory tickets = good.getTickets();
        uint256[] memory ticketIds = new uint256[](count);

        uint256 j = 0;
        for (uint256 i = 0; i < tickets.length; i++) {
            if (tickets[i] == user) {
                ticketIds[j] = i;
                j++;
            }
        }
        return ticketIds;
    }

    function getUserRecords(uint256 index)
        public
        view
        returns (UserJoinRecord[] memory record)
    {
        GoodLottery[] memory goodContracts = comptroller.getGoods();
        if (index >= goodContracts.length) return record;
        GoodLottery good = goodContracts[index];
        GoodInterface.UserJoinRecord[] memory records = good
            .getUserJoinRecords();
        UserJoinRecord[] memory result = new UserJoinRecord[](records.length);

        uint256 len = records.length;
        for (uint256 i = 0; i < len; i++) {
            uint256 j = len - 1 - i;

            string memory userName = comptroller.userNames(records[j].user);

            result[i] = UserJoinRecord(
                userName,
                index,
                good.goodId(),
                records[j].user,
                records[j].count,
                true,
                good.winner() != address(0),
                records[j].joinTime,
                records[j].joinBlockNum,
                good.winner() == records[j].user,
                good.goodValue(),
                good.paybackFee()
            );
        }

        return result;
    }

    function getUserRecord(GoodLottery good, address addr)
        public
        view
        returns (UserJoinRecord memory record)
    {
        if (addr != address(0)) {
            (
                address user,
                uint256 count,
                bool joined,
                bool isPaybacked,
                uint256 joinTime,
                uint256 joinBlockNum
            ) = good.userMapping(addr);
            record.goodId = good.goodId();
            record.user = user;
            record.count = count;
            record.joined = joined;
            record.isPaybacked = isPaybacked;
            record.joinTime = joinTime;
            record.joinBlockNum = joinBlockNum;
        }

        return record;
    }

    function getWinnerHistory() public view returns (WinnerHistory[] memory) {
        GoodLottery[] memory goodContracts = comptroller.getGoods();

        if (goodContracts.length <= 0) {
            return new WinnerHistory[](0);
        }
        WinnerHistory[] memory records = new WinnerHistory[](
            goodContracts.length
        );
        uint256 j = 0;
        uint256 m = goodContracts.length;
        for (uint256 i = 0; i < goodContracts.length; i++) {
            GoodLottery good = goodContracts[m - i - 1];

            if (good.winner() != address(0)) {
                (uint256 blockNum, uint256 blockTime, uint256 index) = good
                    .winnerTime();
                UserJoinRecord memory record = getUserRecord(
                    good,
                    good.winner()
                );

                records[j] = WinnerHistory({
                    goodId: record.goodId,
                    user: record.user,
                    count: record.count,
                    joined: record.joined,
                    joinTime: record.joinTime,
                    joinBlockNum: record.joinBlockNum,
                    isWinner: true,
                    goodValue: good.goodValue(),
                    blockNum: blockNum,
                    blockTime: blockTime,
                    index: index,
                    goodHash: good.goodHash()
                });
                j++;
            }
        }
        return records;
    }

    function getUserHistory(address user)
        public
        view
        returns (UserJoinRecord[] memory)
    {
        GoodLottery[] memory goodContracts = comptroller.getGoods();
        uint256 count = 0;
        uint256 goods = goodContracts.length;
        for (uint256 i = 0; i < goods; i++) {
            GoodLottery good = goodContracts[i];
            count += good.getUserJoinRecordIndexs(user).length;
        }

        UserJoinRecord[] memory record = new UserJoinRecord[](count);
        uint256 j = 0;

        for (uint256 i = 0; i < goodContracts.length; i++) {
            UserJoinRecord[] memory rs = getUserHistoryByGood(
                goodContracts[i],
                user
            );
            for (uint256 z = 0; z < rs.length; z++) {
                record[j] = rs[z];
                record[j].goodId = goodContracts[i].goodId();
                record[j].goodIndex = i;
                record[j].isWinner = goodContracts[i].winner() == user;
                record[j].goodValue = goodContracts[i].goodValue();
                record[j].paybackFee = goodContracts[i].paybackFee();
                j++;
            }
        }
        return record;
    }

    function getUserHistoryByGood(GoodLottery good, address user)
        public
        view
        returns (UserJoinRecord[] memory)
    {
        uint256[] memory indexs = good.getUserJoinRecordIndexs(user);
        (
            address user,
            uint256 count,
            bool joined,
            bool isPaybacked,
            uint256 joinTime,
            uint256 joinBlockNum
        ) = good.userMapping(user);
        uint256 startIndex = 0;
        if (indexs.length <= 0) {
            return new UserJoinRecord[](0);
        }
        UserJoinRecord[] memory records = new UserJoinRecord[](indexs.length);

        for (uint256 z = 0; z < indexs.length; z++) {
            (user, startIndex, count, joinTime, joinBlockNum) = good
                .userJoinRecords(z);
            records[z] = UserJoinRecord(
                "",
                0,
                0,
                user,
                count,
                true,
                isPaybacked,
                joinTime,
                joinBlockNum,
                false,
                0,
                0
            );
        }
        return records;
    }

    function getUserTransferHistory(address user)
        public
        view
        returns (UserTransferHistory[] memory record)
    {
        WishToken tokenApi = WishToken(comptroller.token());

        WishToken.UserTransferHistory[] memory list = tokenApi
            .getUserTransferHistories(user);
        record = new UserTransferHistory[](list.length);

        uint256 i = 0;
        for (uint256 j = list.length - 1; j > 0; j--) {
            WishToken.UserTransferHistory memory history = list[j];
            UserTransferHistory memory result = UserTransferHistory({
                from: history.from,
                to: history.to,
                amount: history.amount,
                blockNum: history.transferBlock,
                transferType: 0,
                goodIndex: 0,
                goodId: 0,
                goodHash: "0"
            });

            if (result.from == address(0)) {
                result.transferType = 1;
                record[i] = result;
                continue;
            }

            if (result.to == address(0)) {
                result.transferType = 2;
                record[i] = result;
                continue;
            }

            (
                bool isList,
                uint32 goodId,
                uint256 goodIndex,
                GoodLottery good
            ) = comptroller.goodAddressMapping(result.from);
            if (isList) {
                result.transferType = 3;
                result.goodId = goodId;
                result.goodIndex = goodIndex;
                result.goodHash = good.goodHash();
                record[i] = result;
                continue;
            }

            (isList, goodId, goodIndex, good) = comptroller.goodAddressMapping(
                result.to
            );
            if (isList) {
                result.transferType = 4;
                result.goodId = goodId;
                result.goodIndex = goodIndex;
                result.goodHash = good.goodHash();
                record[i] = result;
                continue;
            }

            record[i] = result;
        }
    }

    function getUserPublishedGoods(address account)
        public
        view
        returns (UserPublishedGood[] memory)
    {
        address[] memory goods = comptroller.getUserPublishedGoods(account);

        UserPublishedGood[] memory records = new UserPublishedGood[](
            goods.length
        );

        for (uint256 i = 0; i < goods.length; i++) {
            GoodLotteryNFT nft = GoodLotteryNFT(goods[i]);
            UserPublishedGood memory record = UserPublishedGood({
                isList: true,
                goodId: nft.goodId(),
                goodIndex: 0,
                goodValue: nft.goodValue(),
                maintenanceFee: nft.maintenanceFee(),
                publishTime: nft.publishTime(),
                lockedTime: nft.lockedTime(),
                goodHash: nft.goodHash(),
                nftAddress: address(nft.nftToken()),
                tokenId: nft.tokenId(),
                status: 0,
                nft: goods[i],
                joinedUsers: 0,
                ticketCounts: 0,
                winner: address(0),
                paybackFee: 0,
                winnerBlock: 0,
                winnerTime: 0,
                winnerIndex: 0,
                goodAddress: address(nft)
            });
            if (comptroller.goodIsList(record.goodId, goods[i])) {
                record.status = 1;
                (
                    bool isList,
                    uint32 goodId,
                    uint256 goodIndex,
                    GoodLottery good
                ) = comptroller.goodsMapping(nft.goodId());
                record.goodIndex = goodIndex;
                record.winner = nft.winner();
                (
                    uint256 winnerBlock,
                    uint256 winnerTime,
                    uint256 tickIndex
                ) = nft.winnerTime();
                record.winnerTime = winnerTime;
                record.winnerBlock = winnerBlock;
                record.winnerIndex = tickIndex;
                record.paybackFee = nft.paybackFee();
            } else if (nft.isApproved()) {
                record.status = 2;
            } else {
                record.status = 3;
            }

            records[i] = record;
        }
        return records;
    }
}
